async function polling(t){try{const n=await ajaxCall({url:"admin/polling.php",method:"POST",returnType:"json"});$.each(n,(t,n)=>{const e=$("#"+t+"_element");e.html(0===parseInt(n)?"":n)}),setTimeout(()=>polling(t),5e3)}catch(n){"timeout"!==n.statusText&&console.error("Polling error:",n),setTimeout(()=>polling(t),5e3)}}$(document).ready(function(){const t=["notification","displaced","transfers"];polling(t)});